import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink
} from "react-router-dom";
import route from './components/NotFound/NotFound';
import './custom.css';

export default class App extends Component {
  static displayName = App.name;

  render() {
    return (
      <Router>
      {/* <Home /> */}
      <div>
      
      <div>
        <Switch>
          <Route path="/" exact={true}  component={Home} />
          
          <Route path="/menu" exact={false} component={MenuProduct} />
          <Route path="/contact" exact={false}  component={Contact} />
          <Route path="/about" exact={false}  component={About} />
        </Switch>
        </div>

      </div>
      </Router>
    );
  }
}
